bool second_supress(const float yaw_to_break, SDK::CUserCmd* cmd, SDK::CUserCmd* ucmd)
{

	auto local_player = INTERFACES::ClientEntityList->GetClientEntity(INTERFACES::Engine->GetLocalPlayer());

	if (!local_player)
		return false;

	if (!local_player)
		return 0;

	float get_curtime(SDK::CUserCmd* ucmd)
		; {
		int g_tick = 0;
		SDK::CUserCmd* g_pLastCmd = nullptr;
		if (!g_pLastCmd || g_pLastCmd->hasbeenpredicted) {
			g_tick = (float)local_player->GetTickBase();
		}
		else {
			++g_tick;
		}
		g_pLastCmd = ucmd;
		float curtime = g_tick * INTERFACES::Globals->interval_per_tick;
		return curtime;
	}

	static float next_lby_update_time = 0;
	float curtime = get_curtime(cmd);

	auto animstate = local_player->GetAnimState();
	if (!animstate)
		return false;

	if (!(local_player->GetFlags() & FL_ONGROUND))
		return false;

	if (SETTINGS::settings.delta_val < 120)
		return false;

	if (animstate->speed_2d > 0.1)
		next_lby_update_time = curtime + 0.22 + TICKS_TO_TIME(1);


	if (next_lby_update_time < curtime)
	{
		next_lby_update_time = curtime + 1.1;
		return true;
	}

	return false;
}

bool next_lby_update(const float yaw_to_break, SDK::CUserCmd* cmd, SDK::CUserCmd* ucmd)
{
	auto local_player = INTERFACES::ClientEntityList->GetClientEntity(INTERFACES::Engine->GetLocalPlayer());

	if (!local_player)
		return false;

	if (!local_player)
		return 0;

	float get_curtime(SDK::CUserCmd* ucmd)
		; {
		int g_tick = 0;
		SDK::CUserCmd* g_pLastCmd = nullptr;
		if (!g_pLastCmd || g_pLastCmd->hasbeenpredicted) {
			g_tick = (float)local_player->GetTickBase();
		}
		else {
			++g_tick;
		}
		g_pLastCmd = ucmd;
		float curtime = g_tick * INTERFACES::Globals->interval_per_tick;
		return curtime;
	}

	static float next_lby_update_time = 0;
	float curtime = get_curtime(cmd);

	auto animstate = local_player->GetAnimState();
	if (!animstate)
		return false;

	if (!(local_player->GetFlags() & FL_ONGROUND))
		return false;

	if (animstate->speed_2d > 0.1)
		next_lby_update_time = curtime + 0.22 - TICKS_TO_TIME(1);

	if (next_lby_update_time < curtime)
	{
		next_lby_update_time = curtime + 1.1f;
		return true;
	}

	return false;
}

void CFakewalk::do_fakewalk(SDK::CUserCmd* cmd)
{
	if (SETTINGS::settings.fakewalk)
	{
		if (GetAsyncKeyState(VK_SHIFT)) //make sure fakelag is set to max when u trigger fakewalk!
		{
			auto local_player = INTERFACES::ClientEntityList->GetClientEntity(INTERFACES::Engine->GetLocalPlayer());

			if (!local_player || local_player->GetHealth() <= 0)
				return;

			auto net_channel = INTERFACES::Engine->GetNetChannel();
			if (!net_channel)
				return;

			auto animstate = local_player->GetAnimState();
			if (!animstate)
				return;

			const int choked_ticks = net_channel->m_nChokedPackets;

			fake_walk = true;

			if (!choked_ticks || choked_ticks > 8)
			{
				cmd->sidemove = 0;
				cmd->forwardmove = 450;

				if (!choked_ticks || animstate->speed_2d < 0.1)
					cmd->forwardmove = 0;

				aimbot->rotate_movement(UTILS::CalcAngle(Vector(0, 0, 0), local_player->GetVelocity()).y + 180.f, cmd);
			}
		}
		else
			fake_walk = false;
	}
}
	

